"     <li>",
"      BD&trade; Glucose [OTC];",
"     </li>",
"     <li>",
"      Dex4&reg; [OTC];",
"     </li>",
"     <li>",
"      Enfamil&reg; Glucose [OTC];",
"     </li>",
"     <li>",
"      GlucoBurst&reg; [OTC];",
"     </li>",
"     <li>",
"      Glutol&trade; [OTC];",
"     </li>",
"     <li>",
"      Glutose 15&trade; [OTC];",
"     </li>",
