var title_f16_7_16507="Pelvic muscle exercises PI";
var content_f16_7_16507=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F81507&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F81507&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Pelvic muscle exercises",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Identify the correct muscles to contract. Women can do this by placing a finger in the vagina and squeezing the muscles around their finger. Another way is for a woman to imagine that she is sitting on a marble. Imagine using the vaginal muscles to gently lift the marble off the chair. The muscles of the buttocks, abdomen, and thighs should not be used.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Second, hold the pelvic muscle contraction approximately 8 to 10 seconds, and then relax the muscles; adequate relaxation is as important as contraction. In the beginning, it may not be possible to hold the contraction for more than one second. Perform 8 to 12 contractions followed by relaxation three times. Try to do this every day, but no less than three or four times a week. The exercise regimen should be continued for at least 15 to 20 weeks.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Over time, try to hold the contraction harder and for a longer time. These exercises need to be continued indefinitely to have a lasting effect, similar to other forms of exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        In patients whose muscles are weak, the exercises should initially be done while lying down. As the muscles become stronger, the exercises may be done while sitting or standing. The muscles should be contracted during activities that can cause urine leakage, such as during physical exercise, lifting, coughing or sneezing.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
